import { Stack } from '@mui/material';
import React from 'react'

const Pagination = ({setOffset}) => {
  return (
    <Stack>
      <Pag
        onClick={() => {
          setOffset((prevOffSet) => prevOffSet - 5);
        }}
      >
        {"<"}
      </Pag>
      <button
        onClick={() => {
          setOffset((prevOffSet) => prevOffSet + 5);
        }}
      >
        {">"}
      </button>
    </Stack>
  )
}

export default Pagination
